package org.example.cli.puzzle8;

import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;
import java.util.ArrayList;
import java.util.Collections;
import java.util.Comparator;
import java.util.List;

public class Puzzle8 {

    public static void main(String[] args) throws IOException {
        Path inputPath = Path.of("src/main/java/org/example/cli/puzzle8/8.input");
        List<String> lines = Files.readAllLines(inputPath);

        List<Point> points = new ArrayList<>();
        for (String line : lines) {
            if (line.isBlank()) continue;
            String[] parts = line.split(",");
            long x = Long.parseLong(parts[0].trim());
            long y = Long.parseLong(parts[1].trim());
            long z = Long.parseLong(parts[2].trim());
            points.add(new Point(x, y, z));
        }

        List<Edge> edges = new ArrayList<>();
        for (int i = 0; i < points.size(); i++) {
            for (int j = i + 1; j < points.size(); j++) {
                long distSq = points.get(i).distanceSquared(points.get(j));
                edges.add(new Edge(i, j, distSq));
            }
        }

        edges.sort(Comparator.comparingLong(Edge::distSq));

        UnionFind uf = new UnionFind(points.size());
        int connectionsToMake = 1000;
        int limit = Math.min(connectionsToMake, edges.size());

        for (int i = 0; i < limit; i++) {
            Edge e = edges.get(i);
            uf.union(e.u, e.v);
        }

        List<Integer> sizes = uf.getComponentSizes();
        sizes.sort(Collections.reverseOrder());

        long result = 1;
        for (int i = 0; i < 3 && i < sizes.size(); i++) {
            result *= sizes.get(i);
        }

        System.out.println(result);
    }

    record Point(long x, long y, long z) {
        long distanceSquared(Point other) {
            long dx = x - other.x;
            long dy = y - other.y;
            long dz = z - other.z;
            return dx * dx + dy * dy + dz * dz;
        }
    }

    record Edge(int u, int v, long distSq) {}

    static class UnionFind {
        private final int[] parent;
        private final int[] size;

        public UnionFind(int n) {
            parent = new int[n];
            size = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                size[i] = 1;
            }
        }

        public int find(int i) {
            if (parent[i] != i) {
                parent[i] = find(parent[i]);
            }
            return parent[i];
        }

        public void union(int i, int j) {
            int rootI = find(i);
            int rootJ = find(j);

            if (rootI != rootJ) {
                if (size[rootI] < size[rootJ]) {
                    int temp = rootI;
                    rootI = rootJ;
                    rootJ = temp;
                }
                parent[rootJ] = rootI;
                size[rootI] += size[rootJ];
            }
        }

        public List<Integer> getComponentSizes() {
            List<Integer> sizes = new ArrayList<>();
            for (int i = 0; i < parent.length; i++) {
                if (parent[i] == i) {
                    sizes.add(size[i]);
                }
            }
            return sizes;
        }
    }
}

